--

CREATE FUNCTION "public"."add_dataset"("datasetobj" "json") RETURNS "void"
    LANGUAGE "plpgsql"
    AS $$
  declare new_dataset_id uuid;
  declare temprow RECORD;
  BEGIN
    values (datasetObj->>'name', datasetObj->>'instructions', datasetObj->>'passkey');

    new_dataset_id := (select dataset.id 
    from dataset
    where passkey = datasetObj->>'passkey');

    for temprow in
      select * from json_to_recordset(datasetObj->'text_samples')
      as x(body text, source_id text)
    LOOP
      values(temprow.body, new_dataset_id);
    end LOOP;

    for temprow in
      select * from json_to_recordset(datasetObj->'response_options')
      as x(label text)
    LOOP
      values(temprow.label, new_dataset_id);
    end LOOP;
    
    for temprow in
      select * from json_to_recordset(datasetObj->'highlight_options')
      as x(label text, color text)
    LOOP
      values(temprow.label, temprow.color, new_dataset_id);
    end LOOP;
  end;
$$;


