--
-- Name: check_dataset_passkey("uuid", "text"); Type: FUNCTION; Schema: public; Owner: supabase_admin
--

CREATE FUNCTION "public"."check_dataset_passkey"("userid" "uuid", "dataset_passkey" "text") RETURNS "uuid"
    LANGUAGE "plpgsql" SECURITY DEFINER
    SET "search_path" TO 'public'
    AS $$
  begin if exists (
    select 
      *
    from 
      dataset 
    where 
      passkey = dataset_passkey
  ) then 
      if not exists (
        select
          *
        from 
          dataset_permission
        join
          dataset 
        on 
          dataset_permission.dataset_id = dataset.id
        where
          dataset_permission.user_id = userid and dataset_permission.dataset_id = dataset.id and dataset.passkey = dataset_passkey
      )
      then insert into dataset_permission(user_id, dataset_id) 
      values 
        (
          userid, 
          (
            select 
              dataset.id 
            from 
              dataset 
            where 
              passkey = dataset_passkey
          )
        );
      end if;
  else raise exception 'Passkey is incorrect';
  end if;
  return
    dataset.id
  from 
    dataset 
  where 
    passkey = dataset_passkey;
  end;
$$;


