--
-- Name: download_dataset("uuid"); Type: FUNCTION; Schema: public; Owner: supabase_admin
--

CREATE FUNCTION "public"."download_dataset"("downloaded_dataset_id" "uuid") RETURNS TABLE("dataset" "json")
    LANGUAGE "plpgsql"
    AS $$
  begin
    return query select row_to_json(d)
    from (
      select name, created,
        (
          select array_to_json(array_agg(row_to_json(h)))
          from (
            select label, color
            from highlight_option
            where dataset_id = downloaded_dataset_id
          ) h
        ) as highlight_options,
        (
          select array_to_json(array_agg(row_to_json(r)))
          from (
            select label
            from response_option
            where dataset_id = downloaded_dataset_id
          ) r
        ) as response_options,
        (
          select array_to_json(array_agg(row_to_json(t)))
          from (
            select source_id, body, 
              (
                select array_to_json(array_agg(row_to_json(u)))
                from (
                  select user_response.comments, response_option.label,
                    (
                      select array_to_json(array_agg(row_to_json(H)))
                      from (
                        select highlight.selection, highlight_option.label
                        from highlight
                        join highlight_option
                        on highlight.highlight_option = highlight_option.id
                        where user_response_id = user_response.id
                      ) H
                    ) as highlights
                  from user_response
                  join response_option
                  on user_response.response_option_id = response_option.id
                  where text_sample_id = text_sample.id
                ) u
              ) as user_responses
            from text_sample
            where dataset_id = downloaded_dataset_id
          ) t
        ) as text_samples
      from dataset
      where id = downloaded_dataset_id
    ) d;
  end;
$$;


